window.bookSummaryJSON = "<p><b>The colonies of the Faustian Chain have gone dark. </b></p> <p>No star freighters have come from the star cluster for many years. Captain Bill Gorman, a smuggler on the Fringe, is one of the few who know the truth. He’s personally battled the alien invaders who’ve overrun the human colonies of the Chain. He and his crew are faced with a choice: Will they fight the invaders, or will they run?</p>"; 
